import React, {useState, useEffect} from "react";
import Main from "./components/Main";
import Header from "./components/Header";

function App() {
  const [cartDisplayHelper, setCartDisplayHelper] = useState(null);

  function handleMain (cartDisplayFunction) {
    useEffect( setCartDisplayHelper(cartDisplayFunction), [])
  }

  return (
    <React.Fragment>
      <Header cartDisplay = {cartDisplayHelper}></Header>
      <Main handler={handleMain}></Main>
    </React.Fragment>
  );
}

export default App;
